    public static boolean isMacOSXEqualsOrBetterThan(final int major_required, final int minor_required) {
        final String os_version = getPrivilegedProperty("os.version");
        final StringTokenizer version_tokenizer = new StringTokenizer(os_version, ".");
        int major;
        int minor;
        try {
            final String major_str = version_tokenizer.nextToken();
            final String minor_str = version_tokenizer.nextToken();
            major = Integer.parseInt(major_str);
            minor = Integer.parseInt(minor_str);
        }
        catch (Exception e) {
            log("Exception occurred while trying to determine OS version: " + e);
            return false;
        }
        return major > major_required || (major == major_required && minor >= minor_required);
    }
    
    public static Map<Integer, String> getClassTokens(final TokenFilter filter, final Map<Integer, String> target, final Class... tokenClasses) {
        return getClassTokens(filter, target, (Iterable<Class>)Arrays.asList((Class[])tokenClasses));
    }
    
    public static Map<Integer, String> getClassTokens(final TokenFilter filter, Map<Integer, String> target, final Iterable<Class> tokenClasses) {
        if (target == null) {
            target = new HashMap<Integer, String>();
        }
        final int TOKEN_MODIFIERS = 25;
        for (final Class tokenClass : tokenClasses) {
            for (final Field field : tokenClass.getDeclaredFields()) {
                if ((field.getModifiers() & 0x19) == 0x19 && field.getType() == Integer.TYPE) {
                    try {
                        final int value = field.getInt(null);
                        if (filter == null || filter.accept(field, value)) {
                            if (target.containsKey(value)) {
                                target.put(value, toHexString(value));
                            }
                            else {
                                target.put(value, field.getName());
                            }
                        }
                    }
                    catch (IllegalAccessException ex) {}
                }
            }
        }
        return target;
    }
    
    public static String toHexString(final int value) {
        return "0x" + Integer.toHexString(value).toUpperCase();
    }
    
